import "./search-box.style.css";

const SearchBox = ()=>{
    const { className, placeholder, OnChangeHandler } = this.props;
    
      <input
        type="search"
        className={`search-box ${className}`}
        placeholder={placeholder}
        onChange={OnChangeHandler}
      />

  }


export default SearchBox;
